import React from 'react'
import '../styles/Sidebar.css';

export default function Sidebar() {
  return (
    <div className="sidebar">

    <i className="sidebar-icon fa-regular fa-heart"></i>
    <i className="sidebar-icon fa-solid fa-magnifying-glass"></i>
    <i className="sidebar-icon fa-solid fa-user"></i>
    <i className="sidebar-icon fa-solid fa-tv"></i>
    <i className="sidebar-icon fa-solid fa-child-reaching"></i>
    <i className="sidebar-icon fa-solid fa-house-user"></i>
  </div>
  )
}
